  [],\n\t\"num_tags\": 0,\n\t\"name\": \"bacteriology-data-from-moored-buoy-casts-and-other-instruments-in-the-delaware-bay-and-north-at\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bacteriology data were collected using
  moored buoy casts and other instruments in the Delaware Bay and North Atlantic Ocean
  from November 5, 1976 to August 16, 1977. Data were submitted by Virginia Institute
  of Marine Science - Gloucester Point as part of the Ocean Continental Shelf (OCS-Mid
  Atlantic Ocean) project. Data has been been processed by NODC to the standard NODC
  F009- Bacteriology formats. Full format descriptions are available from NODC homepage
  at https://intra.nodc.noaa.gov/Information/Teams/apd_info/md_improvementn_project2004/MULDARS_FGDCs/F009.txtnnThe
  F009 format is designed to support bacteriological studies of the water column and
  ocean bottom. Information on environmental conditions, physical measurements of
  the water and sediment, and denisty of heterotrophic, hydrocarbonclastic, and halophilic
  bacteria are presented. The format contains five data record types, each 80 characters
  in length, sorted by station ad sequence numbers. The first nine columns for all
  records are to be used for file name (columns 1-3) and file identifier (columns
  4-9). The file identifier, to be assigned by the orginator, is an unique originator
  id for each data submission. After submission, the NODCreassigns to this field an
  unique NODC indentifier for internal use.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
